import React from "react";
import { List, Header } from "semantic-ui-react";

export const Streamer = ({ streamer }) => {
  return (
    <List>
      {Object.keys(streamer).map(function (key, index) {
        return (
          <List.Item key={key}>
            <Header>{key}</Header>
          </List.Item>
        );
      })}
    </List>
  );
};
